import React from 'react';
import './IntroCard.scss';

export default function IntroCard(props) {
  return (
    <div className="intro">
      <div className="left">
        <h1>{props.title}</h1>
        <h3>{props.text}</h3>
        <button>{props.button}</button>
      </div>
      <div className="right">
        <div className="right">
          <img src="/assets/homepage.png" alt="home"></img>
        </div>
      </div>
    </div>
  );
}
